  display: table-row;
  height: 30px;
}
.table-th {
  display: table-cell;
  font-weight: bold;
  height: 100%;
  border: 1px solid gray;
  text-align: center;
  vertical-align: middle;
}

.table-td {
  display: table-cell;
  line-height: 20px;
  border: 1px solid gray;
  text-align: center;
  vertical-align: middle;
  width: 80px;
  padding: 8px;
}

.table-td-lg {
  display: table-cell;
  line-height: 20px;
  border: 1px solid gray;
  text-align: center;
  vertical-align: middle;
  width: 110px;
  padding: 5px;
}

.table-td-xlg {
  display: table-cell;
  line-height: 20px;
  border: 1px solid gray;
  text-align: center;
  vertical-align: middle;
  width: 130px;
  padding: 5px;
}

.head-td {
  display:table-cell;
  line-height:20px;
  text-align:left;
  vertical-align:middle;
  width:160px;
  padding:5px;
}

.head-caption{
  display:table-cell;
  font-size:16pt;
  line-height:16pt;
  width:960px;
  padding:5px;
}


.print-footer{

  position:fixed;bottom:5px; right:10px

}

.Low {
  color: blue;
}
.High {
  color: red;
}
`
  const style = iframe.document.createElement('style')
  style.rel = 'stylesheet'
  style.type = 'text/css'
  style.innerHTML = styleClass
  iframe.document.body.appendChild(style)
}

/**
 * @param {Function} func
 * @param {number} wait
 * @param {boolean} immediate
 * @return {*}
 */
export function debounce (func, wait, immediate) {
  let timeout, args, context, timestamp, result
  const later = function () {
    // 
    const last = +new Date() - timestamp
    //  last  wait
    if (last < wait && last > 0) {
      timeout = setTimeout(later, wait - last)
    } else {
      timeout = null
      // immediate===true
      if (!immediate) {
        result = func.apply(context, args)
        if (!timeout) context = args = null
      }
    }
  }
  return function (...args) {
    context = this
    timestamp = +new Date()
    const callNow = immediate && !timeout
    // 
    if (!timeout) timeout = setTimeout(later, wait)
    if (callNow) {
      result = func.apply(context, args)
      context = args = null
    }
    return result
  }
}

