  border: 1px solid gray;
  text-align: center;
  vertical-align: middle;
}

.table-td {
  display: table-cell;
  line-height: 20px;
  border: 1px solid gray;
  text-align: center;
  vertical-align: middle;
  width: 80px;
  padding: 8px;
}

.table-td-lg {
  display: table-cell;
  line-height: 20px;
  border: 1px solid gray;
